import React, { useState } from "react";
import AppHeader from "../components/AppHeader";
import Grid from "@material-ui/core/Grid";
import { Typography, Paper, makeStyles, Toolbar, Card, CardMedia } from "@material-ui/core";
import AppDrawer from "../components/AppDrawer";




import styles from "../styles/HomeStyle";

const useStyles = makeStyles(styles);


export default function Home() {

  const classes = useStyles();

  const [drawerOpen, setDrawerOpen] = useState(false);


  const handleDrawerOpen = (e) => {
    console.log("open drawer");
    setDrawerOpen(true);
  }

  return (
    <React.Fragment>
      <AppHeader calssName={classes.appHeader} handleDrawerOpen={handleDrawerOpen}/>
      {/* <div className={classes.offset} /> */}

      <AppDrawer open={drawerOpen} />

      <Toolbar />
      
      <Grid 
        container 
        direction="column" 
        alignItems="center" 
        spacing={2} 
        className={classes.mainArea}
      >
        <Grid item>
          <Paper fullWidth>This is main area</Paper>
        </Grid>
        <Grid item>
          <Paper>This is main area2</Paper>
        </Grid>
        <Grid item>
          <Card>
            <CardMedia
              image="/public/images/future.png"
            />
            <Typography>this is card</Typography>
          </Card>
        </Grid>
      </Grid>
    </React.Fragment>
  );
}
